import Head from "next/head";
import Container from "../components/container";

const Index = () => {
  return (
    <div>
      <Head>
        <title>Next | Home</title>
      </Head>
      <Container>
        <h1>Home</h1>
      </Container>
    </div>
  );
};

export default Index;
